import React from 'react'

export default function ToDoItem({id, title, done, StatusDone}) {
  return (
    <div className={s.ToDoItem}>
        <p>{title}</p>
        <input type="checkbox" checked={!!done} onChange={()=>StatusDone(id)}/>
    </div>
  )
}
